import * as React from 'react';
import { Avatar, Button, Card, Title, Paragraph, Text } from 'react-native-paper';
import { View, StyleSheet, Image, ScrollView, SafeAreaView } from 'react-native';

const RestaurantCard = (props) => (
    <Card style={{ height: 220, width: 350, marginTop: 15, marginBottom: 15, elevation: 5, shadowColor: "#000",
     shadowOffset: {width: 0,height: 2,
    },shadowOpacity: 0.25, shadowRadius: 3.84 }} >
        <Card.Cover source={{ uri: props.img }} style={{ height: 150, width: 350, }} />
        <Card.Content>
            <Title>{props.name}</Title>
            <Paragraph>{props.foodType} cuisine</Paragraph>
        </Card.Content>

    </Card>
);

const styles = StyleSheet.create({

    shadow:{
       padding:20,
       backgroundColor:'#d9d9d9',
       shadowColor: "#000000",
       shadowOpacity: 0.8,
       shadowRadius: 2,
       shadowOffset: {
         height: 1,
         width: 1
       }
      },
    })

export default RestaurantCard;

